description:
Race 3 ✅

Dunderkörning av @tobiasbrink startade P6 och tog sig upp till P2! Fantastiskt bra race som avslut på den här säsongen. @magnusgustavsen startade från pole, fick en mindre bra start men gjorde en oerhörd insats på banan, slutade som P4 efter att ha hållit ivriga bilar bakom sig!

@stcc_official #brinkmotorsport #racing 

@promeister #borgwarner #tmgöresund @projobworkwear @projob_workwear  @felestadnewwaveprofile #gnosjöautomatsvarvning #toorace @apexsweden @makitasverige @hexis_sverige @foliestyle @endlessbraketechnology

📸@helge360

Race 2 ✅

Tufft i starten för @tobiasbrink som startade P2. En push av banan resulterade i P3 som hölls över mållinjen. @magnusgustavsen startade P6 men hade inte samma pace som tidigare race och slutade därför P8.

Än är mästerskapet inte avgjort -vi rullar ut för race 3!

